import React, { FC } from 'react';
import * as S from './logo.styles';

interface LogoProps {
  imageURL: string;
}

const Logo: FC<LogoProps> = ({ imageURL }) => {
  return (
    <div className="grid justify-items-stretch">
    <div className="flex-initial w-80 h-80 self-end justify-self-end">
      <S.LogoStyle src={imageURL} />

    </div>
    </div>
  );
};

export default Logo;
